import ReactDOM from 'react-dom';
import "./index.css";
import Card from './Cards';
import Sdata from './Sdata';


ReactDOM.render(
    <>
    <h1 className="heading_style">Netflix top movies 2021</h1>
    {Sdata.map((val) => {
        return (

            <Card
             key= {val.id}
             imgsrc={val.imgsrc}
             title={val.title}
             mname={val.mname}
             link={val.link}
    />
    );
    })}
    </>,
        document.getElementById("root")
);





























